import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import ImagesAnnotation from './ImagesAnnotation';

function ImagesAnnotationPage() {
  const { id } = useParams();
  const [image, setImage] = useState(null);

  useEffect(() => {
    fetch(`http://localhost:5000/images/edit/${id}`)
      .then((res) => res.json())
      .then((data) => {
        setImage(data.data);
      })
      .catch((error) => {
        console.log("Error fetching image:", error);
      });
  }, [id]);

  return (
    <div>

      {image && (
        <img
          alt="Clicked_Image"
          width={600}
          height={600}
          src={image.image}
        />
      )}
      <ImagesAnnotationPage/>
    </div>
  );
}

export default ImagesAnnotationPage;
